import { Formik } from "formik";
import { useCallback, useState } from "react";
import ClientMapper from "../../mappers/Client/Client";
import { DialogTitle, Dialog, DialogContent, Grid } from "@material-ui/core";
import { Form, FormContainer } from "../../styles/Forms/FormStyles";
import Field from "./Field";

const DialogCreateClient = ({ open, onclose, onCreate }) => {
  const [openAlert, setOpenAlert] = useState(false);
// mantén estos imports tal cual si usas v4

// ...

<Formik
    initialValues={ClientMapper.CreateToObject}
    enableReinitialize={true}
    onSubmit={(values, actions) => {
        openSave(values, actions);
    }}
>
    {({ submitForm, resetForm, isSubmitting }) => (
        <Dialog
            open={open}
            maxWidth="lg"
            fullWidth={true}
            onClose={(event, reason) => {
                if (reason !== "backdropClick") {
                    onclose(event, reason);
                    resetForm();
                }
            }}
        >
            ...
        </Dialog>
    )}
</Formik>
  const [openSeverity, setAlertSeverity] = useState("success");

  const openSave = useCallback((values, actions) => {}, []);

  return (
    <>
      <Formik
        initialValues={ClientMapper.CreateToObject}
        enableReinitialize={true}
        isSubmitting={true}
        onSubmit={(values, actions) => {
          openSave(values, actions);
        }}
      >
        {({ submitForm, resetForm, isSubmitting }) => (
          <Dialog
            open={open}
            maxiWidth="lg"
            fullWidth={true}
            onclose={(event, reason) => {
              if (reason !== "backdropClick") {
                onclose(event, reason);
                resetForm();
              }
            }}
          >
            <DialogTitle>Crear Cliente</DialogTitle>
            <DialogContent>
                <Form>
                    <FormContainer>
                        <Grid container item spacing={2} md={12}>
                            <Field/>
                        </Grid>
                    </FormContainer>
                </Form>
            </DialogContent>
          </Dialog>
        )}
      </Formik>
    </>
  );
};

export default DialogCreateClient;
